from leetcode.longest_palindrome import Solution


def test_cbbd():
    assert Solution().longestPalindrome("cbbd") == "bb"


def test_bb():
    assert Solution().longestPalindrome("bb") == "bb"


def test_eeee():
    assert (
        Solution().longestPalindrome(
            ""
        )
        == ""
    )


def test_babad():
    assert Solution().longestPalindrome("babad") in ["bab", "aba"]


def test_tattarrattat():
    assert Solution().longestPalindrome("tattarrattat") == "tattarrattat"


def test_fucked():
    assert (
        Solution().longestPalindrome(
            ""
        )
        == "sooos"
    )
